GDSC IUCA — студенческий клуб разработчиков Google базирующийся в Международном университете в Центральной Азии, г. Токмок, Кыргызстан. А если быть еще точнее, то это мы - те самые ребята, которые и создали это приложение, которое вы на данный момент используете.

В команду GDSC IUCA входят:
