Проектный менеджер - Попов Данил;
UX/UI дизайнер - Эшанханова Мохирух;
Backend разработчики - Токоев Рысбек, Шибру Давид;
Мобильный разработчик (iOS) - Бектурганов Айдин;
Мобильный разработчик (Android) - Мамбеталиев Азамат;
Главной нашей задачей является решение локальных проблем при помощи инструментов информационных технологий.
